        <Container>
                <Card className="shadow p-2 shadow-lg rounded mt-5 w-75 m-auto">
                    <h3>Top 10 users</h3>
                    <hr></hr>
                    <a href="https://analyze-coderhub.herokuapp.com/top10_file"><i className="bi bi-download"></i></a>
                </Card>
                <Card className="shadow p-2 shadow-lg rounded mt-2 w-75 m-auto">
                    <a href="https://analyze-coderhub.herokuapp.com/top10_file"><i className="bi bi-download"></i></a>
                </Card>
                <Card className="shadow p-2 shadow-lg rounded mt-2 w-75 m-auto">
                    <a href="https://analyze-coderhub.herokuapp.com/top10_file"><i className="bi bi-download"></i></a>
                </Card>
            
        </Container>
    );
}

export default Downlaods;
